import React from 'react';

const workersData = [
  {
    id: 1,
    name: 'John Doe',
    profession: 'Plumber',
    location: 'New York, NY',
    experience: '5 years',
    description: 'Experienced in residential plumbing and repairs.',
  },
  {
    id: 2,
    name: 'Jane Smith',
    profession: 'Electrician',
    location: 'Chicago, IL',
    experience: '7 years',
    description: 'Specialized in commercial wiring and safety compliance.',
  },
  // add more workers
];

const WorkersList = () => (
  <section style={styles.container}>
    <h2>Meet Our Skilled Workers</h2>
    <div style={styles.list}>
      {workersData.map(worker => (
        <div key={worker.id} style={styles.card}>
          <h3>{worker.name}</h3>
          <p><strong>Profession:</strong> {worker.profession}</p>
          <p><strong>Location:</strong> {worker.location}</p>
          <p><strong>Experience:</strong> {worker.experience}</p>
          <p>{worker.description}</p>
        </div>
      ))}
    </div>
  </section>
);

const styles = {
  container: {
    padding: '40px 20px',
    backgroundColor: 'rgba(255,255,255,0.95)',
    color: '#333',
  },
  list: {
    display: 'grid',
    gridTemplateColumns: 'repeat(auto-fit,minmax(250px,1fr))',
    gap: '20px',
  },
  card: {
    backgroundColor: 'white',
    borderRadius: '8px',
    padding: '20px',
    boxShadow: '0 0 10px rgba(0,0,0,0.1)',
  },
};

export default WorkersList;
